import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import MortgageCalculator from './components/MortgageCalculator';
import AutoLoanCalculator from './components/AutoLoanCalculator';
import AdminPanel from './components/AdminPanel';
import AdminLogin from './components/AdminLogin';

function App() {
  return (
    <div>
      <Header />
      <Routes>
        <Route path="/login" element={<AdminLogin />} />
        <Route path="/" element={<MortgageCalculator />} />
        <Route path="/auto-loan" element={<AutoLoanCalculator />} />
        <Route path="/admin" element={<AdminPanel />} />
        {/* Редирект на страницу авторизации для всех неизвестных путей */}
        <Route path="*" element={<AdminLogin />} />
      </Routes>
    </div>
  );
}

export default App;
